import React, {createContext, useState} from "react";

export const AuthContext = createContext();

export default ({children}) => {
    const [userName, setUserName] = useState("");
    const [userEmail, setUserEmail] = useState("");

    return(
        <AuthContext.Provider
            value={{
                userName,
                setUserName,
                userEmail,
                setUserEmail
            }}>
            {children}
        </AuthContext.Provider>
    );
};
